import "./Selection.css";
import Button from "./Button";

const Selection = () => {
    const selectType = "default";
    return (
        <div className={["Selection", `Selection_${selectType}`].join(" ")}>
            <div><button>"이게 맵다고?"</button> </div>
            <div><button>"딱 맛있게 맵다"</button> </div>
            <div><button>"좀 맵지만 먹을 수는 있다"</button> </div>
            <div><button>"휴 도전이었다"</button> </div>
            <div><button>"다시는 못 먹을 매운맛!! ㅠ"</button> </div>
        </div>
    );
}

export default Selection;
